import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <header>
      <div className="container">
        <Link to="/">
          <h2>Workout Buddy</h2>
        </Link>
        <div className="">
          <p>Sign in</p> <p>Sign up</p>
        </div>
      </div>
    </header>
  );
};

export default Navbar;
